  CONSTRAINT `fk_personnel_processed` FOREIGN KEY (`per_id`) REFERENCES `personnel` (`per_id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_request_signatory` FOREIGN KEY (`sign_id`) REFERENCES `signatories` (`sign_id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_student_request` FOREIGN KEY (`stud_id`) REFERENCES `students` (`stud_id`) ON UPDATE CASCADE
